import React, { useState, useEffect } from 'react';
import { createClient } from 'contentful';
import { motion, AnimatePresence } from 'framer-motion';

const contentfulClient = createClient({
  space: process.env.REACT_APP_CONTENTFUL_SPACE_ID,
  accessToken: process.env.REACT_APP_CONTENTFUL_ACCESS_TOKEN,
});

const ArticleCard = ({ article }) => {
  // Add console.log to see what data we're receiving
  console.log('Article data:', article);

  // Safely access fields with optional chaining
  return (
    <motion.div 
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      className="bg-white rounded-xl shadow-sm hover:shadow-md transition-all duration-300 overflow-hidden"
    >
      <div className="p-6">
        <div className="flex items-center gap-3 mb-4">
          <span className="px-3 py-1 text-sm bg-slate-100 text-slate-600 rounded-full">
            {article.fields?.allSidesBiasRating || 'Center'}
          </span>
          <span className="text-emerald-600 text-sm font-medium flex items-center">
            <span className="w-2 h-2 rounded-full bg-emerald-600 mr-2"></span>
            {article.fields?.sentimentType || 'Positive'}
          </span>
        </div>

        <h2 className="text-xl font-semibold text-slate-800 mb-3 leading-tight">
          {article.fields?.title || 'Untitled'}
        </h2>

        <p className="text-slate-600 mb-4 line-clamp-3">
          {article.fields?.summary || 'No summary available'}
        </p>

        <div className="flex flex-wrap gap-2">
          {article.fields?.tags?.map((tag, index) => (
            <span 
              key={index} 
              className="px-3 py-1 text-sm bg-slate-50 text-slate-600 rounded-full"
            >
              {tag}
            </span>
          ))}
        </div>
      </div>
    </motion.div>
  );
};

const App = () => {
  const [articles, setArticles] = useState([]);
  const [activeTab, setActiveTab] = useState('positive');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    async function fetchArticles() {
      try {
        console.log('Fetching articles...');
        const response = await contentfulClient.getEntries({
          content_type: 'page',
          order: '-sys.createdAt',
          limit: 10,
        });

        console.log('Full Contentful response:', response);
        console.log('Articles:', response.items);

        if (response.items.length > 0) {
          console.log('First article fields:', response.items[0].fields);
        }

        setArticles(response.items);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching articles:', error);
        setLoading(false);
      }
    }
    fetchArticles();
  }, []);

  return (
    <div className="min-h-screen bg-slate-100">
      {/* Hero Image Section */}
      <div className="relative h-[40vh] overflow-hidden">
        <div 
          className="absolute inset-0 bg-cover bg-center"
          style={{ 
            backgroundImage: 'url(/pastoral-landscape.jpg)', 
            backgroundPosition: 'center 60%' 
          }}
        />
        <div className="absolute inset-0 bg-gradient-to-b from-transparent to-slate-100" />
      </div>

      {/* Main Content Container */}
      <div className="relative -mt-32">
        <div className="container mx-auto px-4">
          <div className="bg-white rounded-2xl shadow-sm p-8 mb-8">
            <motion.h1 
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              className="text-4xl font-bold text-slate-800 mb-2"
            >
              TrugoodBeautiful
            </motion.h1>
            <motion.p 
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 0.1 }}
              className="text-xl text-slate-600 italic"
            >
              Celebrating what's right with the world
            </motion.p>
          </div>

          {/* Tabs */}
          <div className="bg-white rounded-2xl shadow-sm p-6 mb-8">
            <div className="flex space-x-6 border-b border-slate-100">
              {['positive', 'neutral', 'challenging'].map((tab) => (
                <button
                  key={tab}
                  onClick={() => setActiveTab(tab)}
                  className={`px-4 py-3 text-lg capitalize font-medium transition-colors duration-200
                    ${activeTab === tab 
                      ? 'text-emerald-600 border-b-2 border-emerald-600'
                      : 'text-slate-500 hover:text-slate-800'}`}
                >
                  {tab}
                </button>
              ))}
            </div>
          </div>

          {/* Articles Grid */}
          {loading ? (
            <div className="text-center py-12">
              <div className="w-12 h-12 border-4 border-slate-200 border-t-emerald-600 rounded-full animate-spin mx-auto mb-4" />
              <p className="text-slate-600">Loading stories...</p>
            </div>
          ) : (
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 mb-12">
              <AnimatePresence>
                {articles.map((article) => (
                  <ArticleCard key={article.sys.id} article={article} />
                ))}
              </AnimatePresence>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default App;
